const images = [
    { src: 'Bike_RGB.jpg', title: 'Bike' },
    { src: 'TREAD_1.jpg', title: 'Tread' },
    { src: 'iOS_App.png', title: 'iOS App' },
    { src: 'AppleWatch_App.jpeg', title: 'Apple Watch' },
    { src: 'Android_App.png', title: 'Android App' },
    { src: 'FireTV_App.png', title: 'Firet TV' }
  ];

export default images;
